import React from "react";

const Statistics = ({good, neutral, bad}) => {

    const total = good + neutral + bad;

    return <div>
        <p>good {good}</p>
        <p>neutral {neutral}</p>
        <p>bad {bad}</p>
        <p>all {total}</p>
        <p>average {(clicks.good - clicks.bad) / total}</p>
        <p>positive {clicks.good / total}</p>
    </div>
}

export default Statistics;
